import Layout from '../components/Layout';
import PropertyDetails from '../components/PropertyDetails';
const MyPropertiesSecond = ()=> (
<Layout>
    <div className='container'>
        <div className='row'>
            <div className='col-12'>
            <h5>MY PROPERTIES</h5>
            <PropertyDetails/>


            </div>
        </div>
    </div>
</Layout>
);
export default MyPropertiesSecond;
